import { useState } from 'react';
import Square from './Square';

function RenderSquare() {
  let [count, setCount] = useState(0);
  setCount = () => {
    count ++;
    console.log(count)
  }
  return (
    <div>
      <div>
        <Square count={count} setCount={setCount}/>
        <Square count={count} setCount={setCount}/>
        <Square count={count} setCount={setCount}/>
      </div>
      <div>
        <Square count={count} setCount={setCount}/>
        <Square count={count} setCount={setCount}/>
        <Square count={count} setCount={setCount}/>
      </div>
      <div>
        <Square count={count} setCount={setCount}/>
        <Square count={count} setCount={setCount}/>
        <Square count={count} setCount={setCount}/>
      </div>
    </div>
  );
}

export default RenderSquare;
